(function () {
    var shortenName = function (name) {
        var shortText = name;
        var spaceIndex = name.indexOf(" ");
        if (spaceIndex !== -1) {
            shortText = name.substring(0, spaceIndex);
        }

        return shortText;
    };

    var UNCLAIM_IMAGE = "";
    var CLAIM_IMAGE = "";
    var claimLinkStyle = "width:16px;height:16px;" +
        "background-repeat: no-repeat;" +
        "background-size:16px;" +
        "background-image:url(data:image/png;base64," + CLAIM_IMAGE + ");" +
        "float:right; padding-right: 0.5em";
    var unClaimLinkStyle = "width:16px;height:16px;" +
        "background-repeat: no-repeat;" +
        "background-size:16px;" +
        "background-image:url(data:image/png;base64," + UNCLAIM_IMAGE + ");" +
        "float:right; padding-right: 0.5em";

    var setCardDisplayedOwner = function ($card, realOwner, owner) {
        realOwner = (realOwner === "" || realOwner === null) ? "None" : realOwner;
        owner = (owner === "" || owner === null) ? "None" : owner;
        $card.find('.cardRealOwnerName').text("(" + realOwner + ") " + shortenName(owner));
        if (realOwner === "None") {
            $card.find('.claimButton').attr('style', unClaimLinkStyle);
        } else {
            $card.find('.claimButton').attr('style', claimLinkStyle);
        }
    };

    var setRealOwner = function (newOwnerDisplayName, $card) {
        var formattedId = $card.find('.leftCardHeader').text();
        var modelName = formattedId.substring(0, 1) == "S" ? "HierarchicalRequirement" : "Defect";
        Rally.data.ModelFactory.getModel({
            type:modelName,
            success:function (model) {
                model.find({
                    filters:[
                        {
                            property:'FormattedID',
                            value:formattedId
                        }
                    ],
                    callback:function (record) {
                        var currentRealOwner = record.get('RealOwner');
                        var currentOwner = record.get('Owner') === null ? "None" : record.get('Owner')._refObjectName;


                        var newRealOwner = shortenName(newOwnerDisplayName);
                        if (currentRealOwner === newRealOwner) {
                            newRealOwner = null;
                        }

                        record.set('RealOwner', newRealOwner);
                        record.save();
                        setCardDisplayedOwner($card, newRealOwner, currentOwner);
                    }
                });
            }
        });
    };

    var setNewOwner = function (newOwnerDisplayName, $card) {
        var formattedId = $card.find('.leftCardHeader').text();
        var modelName = formattedId.substring(0, 1) == "S" ? "HierarchicalRequirement" : "Defect";

        Rally.data.ModelFactory.getModel({
            type:'User',
            success:function (model) {
                model.find({
                    filters:[
                        {
                            property:'DisplayName',
                            value:newOwnerDisplayName
                        }
                    ],
                    callback:function (ownerRecord) {
                        Rally.data.ModelFactory.getModel({
                            type:modelName,
                            success:function (model) {
                                model.find({
                                    filters:[
                                        {
                                            property:'FormattedID',
                                            value:formattedId
                                        }
                                    ],
                                    callback:function (storyRecord) {
                                        var currentOwner = storyRecord.get('Owner');
                                        if (currentOwner == null || currentOwner._refObjectName !== ownerRecord.get('DisplayName')) {
                                            storyRecord.set("Owner", ownerRecord.data);
                                            storyRecord.save();
                                        }
                                        setRealOwner(newOwnerDisplayName, $card);
                                    }
                                });
                            }
                        });
                    }
                });
            }
        });
    };

    var isCardInColumn = function ($card, column) {
        var columnHeaderText = $card.parents('.column').find('.columnHeader').text();
        return columnHeaderText.indexOf(column) !== -1;
    };

    var claimButtonClicked = function () {
        var $card = $(this).parents('.card');
        var newOwnerDisplayName = $('#options').find('a').first().text();

        if (isCardInColumn($card, 'Building')) {
            setNewOwner(newOwnerDisplayName, $card);
        } else {
            setRealOwner(newOwnerDisplayName, $card);
        }

        return false;
    };

    var addClaimButtonToKanbanCard = function ($card) {
        var claimHtml = " <a title='Claim' style='" + claimLinkStyle + "' class='claimButton' href='#'></a>";
        var unClaimHtml = " <a title='Claim' style='" + unClaimLinkStyle + "' class='claimButton' href='#'></a>";

        var $nameDiv = $card.find('.cardRealOwnerName');
        if (!$nameDiv.data('claimButtonAdded')) {
            $nameDiv.data('claimButtonAdded', true);
            $nameDiv.css("display", "inline-block");
            $nameDiv.css("float", "right");
            if ($nameDiv.text() === 'None') {
                $nameDiv.after(unClaimHtml);
            } else {
                $nameDiv.after(claimHtml);
            }

            $card.find('.claimButton').click(claimButtonClicked);
        }
    };

    var replaceOwner = function (d) {
        $('.cardOwnerName', d).each(function () {
            if ($(this).is(':visible')) {
                $(this).hide();
                $(this).parents('.card').find('img.cardOwner').remove();

                var $realOwnerDiv = $("<div style='padding-right:0.5em' class='cardRealOwnerName'></div>");
                $(this).after($realOwnerDiv);
                var $card = $($(this).parents('.card')[0]);
                var formattedId = RallyUtil.getFormattedIdForCard($($(this).parents('.card')[0]));
                RallyUtil.queryForArtifact(formattedId, function (record) {
                    var owner = record.get('Owner') === null ? "None" : record.get('Owner')._refObjectName;
                    setCardDisplayedOwner($card, record.get('RealOwner'), owner);
                    addClaimButtonToKanbanCard($card);
                });
            }
        });
    };

    RallyUtil.waitForIframeElementsAndExecute(['.cardOwnerName'], replaceOwner);
})();
